    data: |
      SELECT ( + ( - col2 ) ) FROM tab2 (FORMAT parquet) cor0 WHERE NOT ( NOT - 34 - - col2 * col1 NOT BETWEEN - col1 AND + - col1 );
  - name: tab2

outputs:
  - name: q7104.out
    data: |
      -23
      -40
      -58
